import { Component } from '@angular/core';

@Component({
  selector: 'app-render-list',
  templateUrl: './render-list.component.html',
  styleUrls: ['./render-list.component.css']
})
export class RenderListComponent {
  carro = [
    {modelo: "qq", marca: "audi"},
    {modelo: "urus", marca: "lamborghine"},
    {modelo: "skyline", marca: "nissan"},
    {modelo: "uno", marca: "fiat"}
  ]

}
<div class="aula">
        <h1>Meus carros:</h1>
        <ul>
            <li *ngFor="let carro of carro">Modelo: {{carro.modelo}}-{{carro.marca}}</li>
        </ul>


</div>
